(1, 1, 1, 'Podkreślający figurę filcowy płaszcz z miękkiej mieszanki zawierającej wełnę. Kołnierz i klapy, z przodu kryte zatrzaski. Wyjmowany pasek wiązany w talii. Kieszenie w szwie bocznym, rozcięcie z tyłu. Z podszewką', '', 'plaszcz-z-domieszka-welny', '', '', '', 'Płaszcz z domieszką wełny', '', '', '', ''),
(2, 1, 1, 'Krótki płaszcz z miękkiego materiału futerkowego. Otwarte klapy, zapięcie na kryte zatrzaski, kieszenie po bokach. Z podszewką', '', 'krotki-plaszcz-pluszowy', '', '', '', 'Krótki płaszcz pluszowy', '', '', '', ''),
(3, 1, 1, 'Dwurzędowy płaszcz z mieszanki zawierającej włoską wełnę. Otwarte klapy, zapięcie z przodu, po bokach kieszenie z wypustką, jedna kieszeń wewnętrzna. Rozcięcie z tyłu. Z podszewką. Wełna zawarta w płaszczu pochodzi z recyklingu', '', 'plaszcz-z-domieszka-welny', '', '', '', 'Płaszcz z domieszką wełny', '', '', '', ''),
(4, 1, 1, 'Szeroki sweter w prążki z miękkiej dzianiny z domieszką wełny. Golfowy kołnierz, mocno obniżone ramiona, szerokie rękawy ze ściągaczem. Nieco dłuższy tył', '', 'golf-o-splocie-w-prazki', '', '', '', 'Golf o splocie w prążki', '', '', '', ''),
(5, 1, 1, 'Bawełniany sweter o splocie w prążki. Dekolt w serek, obniżone ramiona, rękawy i dół ze ściągaczem', '', 'bawelniany-sweter-w-serek', '', '', '', 'Bawełniany sweter w serek', '', '', '', ''),
(6, 1, 1, 'Koszula z bawełnianej tkaniny. Kołnierzyk, guziki z przodu, z tyłu karczek z kontrafałdą, długie rękawy z zapinanym mankietem. Zaokrąglony dół i nieco dłuższy tył', '', 'bawelniana-koszula', '', '', '', 'Bawełniana koszula', '', '', '', ''),
(7, 1, 1, 'Obszerny sweter z miękkiej dzianiny. Głęboki dekolt w serek, reglanowy rękaw. Ściągacz wokół szyi, rękawów i u dołu', '', 'sweter-z-dekoltem-w-serek', '', '', '', 'Sweter z dekoltem w serek', '', '', '', ''),
(8, 1, 1, 'Tkaninowe spodnie z wyjmowanym paskiem wiązanym. Po bokach kieszenie. Rozporek na suwak i kryte haftki. Wysoka elastyczna talia. Zwężane nogawki do kostki z kantem', '', 'spodnie-z-marszczona-talia', '', '', '', 'Spodnie z marszczoną talią', '', '', '', ''),
