(10, 1, 1, 'Obszerny sweter z miękkiej dzianiny. Głęboki dekolt w serek, reglanowy rękaw. Ściągacz wokół szyi, rękawów i u dołu', '', 'sweter-z-dekoltem-w-serek', '', '', '', 'Sweter z dekoltem w serek', '', '', '', ''),
(11, 1, 1, 'Spodnie z 5 kieszeniami ze spranego, bardzo elastycznego diagonalu. Normalna talia, rozporek na suwak i guzik. Obcisłe nogawki', '', 'spodnie-skinny-fit', '', '', '', 'Spodnie Skinny fit', '', '', '', ''),
(12, 1, 1, 'Nieco krótszy sweter o splocie w prążki z domieszką wełny. Golfowy kołnierz ze zrolowanym brzegiem, obniżone ramiona, zrolowany brzeg rękawów i u dołu swetra', '', 'golf-o-splocie-w-prazki', '', '', '', 'Golf o splocie w prążki', '', '', '', ''),
(13, 1, 1, 'Prosty płaszcz z filcu. Otwarte klapy, kryte zapięcie na zatrzaski, kieszenie po bokach. Z podszewką', '', 'filcowany-plaszcz', '', '', '', 'Filcowany płaszcz', '', '', '', ''),
(14, 1, 1, 'Pudełkowy sweter z golfowym kołnierzem. Mocno obniżone ramiona', '', 'sweter-z-golfem', '', '', '', 'Sweter z golfem', '', '', '', ''),
(15, 1, 1, 'Cienki sweter z miękkiej dzianiny. Nieco szerszy fason, obniżone ramiona. Ściągacz wokół szyi, rękawów i u dołu', '', 'sweter', '', '', '', 'Sweter', '', '', '', ''),
