(20, 1, 1, 'Spodnie z 5 kieszeniami ze spranego, bardzo elastycznego diagonalu. Normalna talia, rozporek na suwak i guzik. Obcisłe nogawki', '', 'spodnie-skinny-fit', '', '', '', 'Spodnie Skinny fit', '', '', '', ''),
