(367, 1, 1, 'Spodnie cargo ze spranej bawełny oksfordzkiej. Po bokach, z tyłu i na nogawkach kieszenie z klapką i zatrzaskiem. Profilujące szwy na kolanach i sznurek u dołu nogawek', '', 'spodnie-cargo', '', '', '', 'Spodnie cargo', '', '', '', ''),
